import Hours from './components/Hours';
import Minutes from './components/Minutes';
import Seconds from './components/Seconds';
import './App.css';

function App() {
  return (
    <div>
      <Hours/>
      Hours
      <Seconds/>
      <Minutes/>
    </div>
  );
}

export default App;
